INSERT INTO `elections_candidate` VALUES (1,'Justiciero Sámuel ','JS','<p>Esto es una prueba para que veáis cómo va. Regístrate para publicar tu c<span style=\"font-size: 10pt; \">andidatura.</span></p>\r\n\r\n<p>Y puedes poner <b>texto en negrita</b></p>\r\n\r\n<ul>\r\n<li>Y una preciosa</li>\r\n<li>lista de cosas</li>\r\n</ul>\r\n\r\n<p>Al hacer login te aparecerá un enlace que dice <i>Publicar/Editar candidatura</i>. Ahí podrás poner:\r\n\r\n</p><ol>\r\n<li>El nombre de tu partido.</li>\r\n<li>Unas siglas representativas</li>\r\n<li>Una URL donde hayas subido una imagen relacionada con tu partido e ideales. Ya sabes, súbelo a Picasa, flickr, imageshack... el que tú quieras. Sólo tienes que poner el enlace</li>\r\n<li>Y el programa electoral, expláyate y muestra a la Hermandad qué pretendes conseguir.</li>\r\n</ol>\r\n\r\nE imágenes!<div>&nbsp;\r\n\r\n<img src=\"http://www.elpais.com/recorte/20070915elpepuage_6/XXLCO/Ies/Perro_Muchacho.jpg\"></div>','http://4.bp.blogspot.com/_yv1e5YUot1E/SYHLELaM4uI/AAAAAAAAUIc/P5NZ4GGYJT0/s400/2496695999_59c56f9550.jpg',11,'2012-02-21 20:34:24'),(2,'Partido para el Refuerzo de las Relaciones Humanas','PRRH','Cierto sector de la Nación Re:Guapera viene observando ciertas conductas preocupantes en nuestra sociedad. La cultura del gregarismo es tal que se están descuidando las relaciones más humanas, las más cálidas, las del \"tú a tú\".\r\n<br><br>\r\nSe ha perdido el quedar a tomar un café a solas para charlar como amigos. El \"¿qué tal te ha ido el día?\" ha ido dando paso a un grupo de veinte personas bailando WARP 1.9. No nos engañemos: si seguimos así, acabaremos bailando con dos docenas de pseudodesconocidos.\r\n<br><br>\r\nNo me malinterpreten, amigos. Está bien el sentimiento de pertenencia a un grupo. Crea sensación de seguridad, te arropa... ¡Pero estamos perdiendo la base de todo! Si reforzamos las relaciones personales entre los ciudadanos, reforzaremos el grupo en su conjunto. Tendremos un ReGuapos fuerte, unido, grande y libre.\r\n<br><br>\r\nEl PRRH tiene como finalidad instaurar lo siguiente:<br>\r\n1.- Cada semana se escogerá por mayoría a dos integrantes de ReGuapos y una actividad. Los integrantes elegidos deben realizar dicha actividad a solas durante esa semana, siempre que los límites temporales y/o geográficos se lo permitan. La finalidad es que dichos sujetos se conozcan un poco más, que estrechen su relación. Que aprendan, en definitiva, que detrás de esa persona con la que han pasado tantos buenos ratos en grupo, hay una faceta más íntima y que merece igualmente la pena conocer.\r\n<br><br>\r\nEjemplos:<br>\r\n- Rebeca y Bárbara tomando un café juntas y charlar de cómo les va todo durante no menos de dos horas.<br>\r\n- Yolanda y Pablol jugando una partida de ajedrez.<br>\r\n- Samuel y Pako jugando al Left 4 Dead en cooperativo durante una tarde.<br>\r\n- Maite y Maíllo salen a dar una agradable vuelta, paseando al perro de Sámer (a la mascota, no al vago de Sámer).<br>\r\n- Sotek y Diego quedan para intercambiar recetas de cocina y prepararlas juntos.<br>\r\n<br>\r\nComo alternativa se propone que los participantes y la actividad sean totalmente aleatorios. Por ejemplo, Saray y Dante podrían ir a cazar murciélagos.\r\n<br><br>\r\nTambién se propone que solo se elija a los participantes y que lleven a cabo dos actividades para acercar a cada uno al mundo del otro. Por ejemplo, Dante podría enseñar a Saray algún videojuego que crea que le puede gustar, mientras que Saray enseñaría a Dante a usar la Themomix. Respeto mutuo, conocimiento y autorrealización personal.\r\n<br><br>\r\n2.- Una vez elegida una persona, no podrá volver a elegirse al menos hasta pasadas cuatro semanas.<br>\r\n3.- Las personas escogidas deben estar capacitadas para llevar a cabo la actividad adjudicada. Así pues, no será válido que a una persona sin brazos se le inste a jugar al baloncesto.<br>\r\n4.- Durante las actividades, los miembros de ReGuapos participantes deberán lavarse obligatoriamente las manos después de hacer pipí, siempre que dispongan de ellas.\r\n<br><br>\r\nPara todo ello, el PRRH está dispuesto a pactar una coalición con cualquier otro partido que tenga las mismas inquietudes, siempre que incluya este bloque de puntos en su programa y se comprometa a cumplirlos, previo estudio de las solicitudes.','http://blueopossum.homestead.com/grumpy/1Out_20to_20Sea.jpg',13,'2012-02-26 14:42:05'),(4,'Partido Anti Súcubos (y otras cosas más)','P.A.S.','<h1 align=\"center\">¿HARTO DE SÚCUBOS QUE SE LLEVAN A TUS COLEGAS Y LES SUCCIONAN EL ALMA? </h1>\r\n<div align=\"center\"><br><img src=\"https://lh3.googleusercontent.com/2-sHuGckh_YgYljxa5u2XI2ZmiUXZW71l0QkOIaPCJ_eqxBNL-SyTMAYOSfmK3vfkr06tks_6oz5rTCuAVrS2oCZMP8cWm3nem1O7A3BiiMH8S7WnkQ\" height=\"284px;\" width=\"320px;\"><br><br><br><br></div>\r\n\r\n\r\n<h1 align=\"center\">¿QUIERES QUE VUELVA ALEX VADER?</h1>\r\n<div align=\"center\"><br><img src=\"https://lh6.googleusercontent.com/WioYJ0fZWOJukNoCkusda4OogfGdlBxoVH6RsChRbQMwayaT_c1WVKFtbMM5Fq3KgXtO9ZTBvNqT_EjGc4XT4UH9iqqU5_P4KS3Htz0gKpdlz0tsP1w\" height=\"180px;\" width=\"180px;\"><br><br><br><br><br></div>\r\n\r\n\r\n<h1 align=\"center\">¿TE GUSTAN LAS EXPLOSIONES?</h1>\r\n<div align=\"center\"><br><img style=\"width: 391px; height: 224px;\" src=\"https://lh6.googleusercontent.com/0D7YaNhmbbNFlywb8bxhMwipEEKPJd6PdcguzdDvxgq8bfnuCKGvwhuqTIKX-DFtShgXtExWYVCErU8NhZ7kqwghR48t715-DTayxnT3PuI24DWIVHI\"><br><br><br><br><br></div>\r\n\r\n\r\n<h1 align=\"center\">¿TE GUSTARÍA TENER UN PERRO RABIOSO QUE LE ARRANCARA LA CABEZA A QUIEN DÉ BAJÓN EN LAS FIESTAS?</h1>\r\n<div align=\"center\"><br><img style=\"width: 414px; height: 370px;\" src=\"https://lh4.googleusercontent.com/KwwMUokSAw_M6g-ZPNbWa_Oj_v84tG2mbsQdjBsMrtXOIBVoWFX8yTdDY8HoqTsL1EQqQ426vRaYWCs8V0Pancj3445bJhQzFOUYXkpCO58SWpJZZgE\"><br><br><br><br></div>\r\n\r\n\r\n<h1 align=\"center\">¡ESTE ES TU PARTIDO, JODER!</h1>\r\n<div align=\"center\"><br></div>\r\n<h1 align=\"center\">VOTA AL P.A.S.</h1>\r\n<div align=\"center\"><br></div>\r\n<h1 align=\"center\">PARTIDO ANTI SÚCUBOS (y otras cosas más)</h1>\r\n<div align=\"center\"><br></div>\r\n<h1 align=\"center\">Promovemos todo tipo de acciones en pro de la moloneidad y la anti sucubez.</h1>\r\n<div align=\"center\"><br>\r\nAdemás, si eres una niña o un niño de esos que le gustan los gatitos\r\n<br><img style=\"width: 389px; height: 276px;\" src=\"https://lh5.googleusercontent.com/iACav2l7nygy069vFvJH6D9o_TBzH6j05x9j0EMS-pk9t--sM_SdwA_D4zEOCAhUcGfxgURZWCP_1GH43JbMPmXpEkwXS68AASoc6W1uv8ksAL7mBvs\"><br>\r\nAhora también tienes sitio en el P.A.S. con nuestra nueva vertiente ideológica “Reinserciona un súcubo”.\r\n<br><br>\r\nPropondremos actividades de grupo donde el súcubo sea capaz de conocer mejor por sí sola a los colegas de su hombre. Si aún así decide seguir jodiendo, será víctima de LA MAZA.\r\n<br><img style=\"width: 410px; height: 273px;\" src=\"https://lh4.googleusercontent.com/_9Ycqz8_V6HmaVy4qvxMUnORwhbZSYDbr9nLTcO7YGVpDH0bnOmXGg0zjmteyA6OVVP4KcmpxxfesWeWJcDxHlpyHrxXquIVolFuovpobIIn3Hc629Y\"></div>\r\n\r\n\r\n','https://lh6.googleusercontent.com/-qgJkOgBdadI/T0tGW4aLF6I/AAAAAAAAAeU/RCS-eCDjmJc/s268/pablol.png',12,'2012-02-27 10:09:41'),(5,'Peugeot 205: Murcia - Belgrado','PG205','<p>\"Jubilarte\" me dijo el muy cabrón. A mis 10 años, él sólo era un niñato besacolumnas y 10 después... ¿ya andaba buscándome un marmolista?. \"Pero antes de ese momento, haremos un último viaje: un viaje a los Balcanes\". Y yo dudé, pues voy teniendo una edad. Del motor sólo se me oye la bronquitis, todo me tiembla a 120 km/h, y con el aire acondicionado me pasa lo que a muchos con el pelo: lo perdimos a mitad de los años 90. </p>\r\n<p>Pero lo hicimos. Más de 6000 km. Conduciendo miles de canciones, con invitados que no sé de dónde sacaba: un reparto de jóvenes aburridos de las guías <i>belgrade-in-2-days</i>, alocadas niñas bien con ansias de libertad, desemplados reconvertidos a la fe en el asfalto... entrando de noche en ciudades cuyo nombre teníamos que consultar en la prensa local al día siguiente, en una ruleta de aventuras de la que volvimos victoriosos&nbsp;apostándolo todo, siempre, al 205 rojo. </p><a href=\"http://postimage.org/\" target=\"_blank\"><img border=\"0\" alt=\"hippies low\" src=\"http://s7.postimage.org/f8cqr2igb/hippies_low.jpg\"></a>','http://s17.postimage.org/atum4872n/murcia_belgrado_low.jpg',14,'2012-02-27 10:36:57'),(6,'Desde Lorca con Rencor ','DLcR','VUESTRAS PROPUESTAS SON TAN ERRONEAS QUE ME OBLIGAIS A PRESENTAR MI CANDIDATURA, LÚSERS!!<br><br>Qué es eso de quedar para tomar un café? que es eso del día a día? que es eso de \"as novias de mis amigos me quitan a mis amigos\". A LLORAR A TU CASA!!!<br><br>El principal objetvo de esto no debe ser fomentar la amistad entre los miembros de la Hermandad. Que nos llevemos bien da igual. Si nos llevamos mal hay conflicto y es mas divertido y se aprende. Lo importante es que la gente sepa que si se va, LO VA A PAGAR.&nbsp; <br><br>Lo que hay que hacer es contratar a un detective privado (con el dinero de maíllo) y conseguir los horarios de Alex Vader y su domicilio. El primer día le dejariamos una cartulina con el logotipo de YouPorn y el texto \"conocemos todos tus secretos\". Poco despues encontraria una chapa de farlicas en su buzón. Unos dias mas tarde, de madrugada, pondríamos una d las canciones de jorge al estilo perro bajo su ventana a todo volumen.<br><br>y así hasta que se sienta vigilado las 24 horas. Así hasta que vuelva.<br><br>Votadme o morid.<br>','http://1.bp.blogspot.com/_KTgoR3cQrGg/SUlpxLsdTEI/AAAAAAAAAC4/NeW6dwDIl-E/s320/molotov.jpg',16,'2012-02-27 14:40:08'),(7,'Loren Party','LP','Hola, amigos y amigas. <br><br>Soy Lorenzo y lo digo abiertamente pues no tengo nada que esconder. Como todos sabéis, yo soy un hombre sencillo que valora las cosas buenas y sencillas de la vida como la amistad, la cerveza fría, los cachorros, los asientos con reposavasos, las dominadas y la diversión saludable y desenfadada al aire libre. También sabréis que yo no soy un pensador, soy un hombre de acción, y es por ello que no soy muy amigo de los grandes discursos. Así que sin más dilación, os dejo aquí mis propuestas para que, si os hacen pensar que nos convertirán en un grupo aún mejor (¡que ya es difícil!), me votéis. Gracias de antemano.<br><br><ol><li>Desterrar los comentarios machistas o misóginos.</li><li>Promover las salidas diurnas a espacios naturales (Valle Perdido, Salto del Usero, etc).</li><li>Promover la salud por medio del deporte.</li><li>Favorecer la tolerancia, el respeto y la igualdad en Re: Guapos.</li><li>Defender los valores de la democracia.</li><li>Promover el uso de acentos graciosos.</li><li>Evitar las descalificaciones gratuitas.</li><li>Crear un grupo de Whatsapp llamado \"Re: polvos\".</li></ol><p>Si fuera necesario estaría dispuesto a pactar con otro(s) partido(s), siempre que éste(éstos) no fomente(n) el odio ni sea(n) enemigo(s) de la democracia. Viendo los partidos que hay hasta el momento, solo podría pactar con el de las relaciones personales, con el de la galleta y con el del coche de Maíllo. <br></p><p><br></p><br>','http://a5.sphotos.ak.fbcdn.net/hphotos-ak-snc6/58634_1561047717222_1566184989_1346212_2337560_n.jpg',17,'2012-02-27 15:21:40'),(8,'Paseos con mi padre','PCMP','<p>Mi padre falleció hace unos meses. Pero tengo su recuerdo y el de aquel coche, un Jeep Wrangler.</p>\r\n<p>Mis mejores momentos con él, fueron cuando cuando aún era un niño y era verano. Descapotábamos el coche y paseábamos por la manga. Yo levantaba los brazos y mi padre subía la música, casi siempre, la de Leonard Cohen.</p>','http://s15.postimage.org/lw0m5ez0b/jeep_wrangler_rubicon.jpg',18,'2012-02-27 15:58:51'),(10,'PARTIDO CACHO BURRO','PCB','Hola querridos ciudadanos de la Hermandad Robot,\r\n<DIV><BR></DIV>\r\n<DIV>Mi parrtido sólo tiene un objetivo: LA CREACIÓN DE UN GENIO.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Desde antaño, los grrandes equipos de la historria de la humanidad han entrado en algún momento en declive porque no han realizado un passover de manera corrrecta. Este equipo, esta hermandad, no se merrece esto, por ello mi partido va a luchar porque esto no se produzca.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>¿Qué pasará cuándo Jorge no esté?</DIV>\r\n<DIV><BR></DIV>\r\n<DIV><IMG src=\"https://fbcdn-sphotos-a.akamaihd.net/hphotos-ak-ash2/25991_1262278354818_1165477088_30709057_2786133_n.jpg\"></DIV>\r\n<DIV><BR></DIV>\r\n<DIV>¿Quién llenará ese vacío de gracia y despiporre que Jorge llenaba en nuestros corazones?</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>¡Hay que ir pensando en quien lo sustituirá! ¡No podemos confiar en que el azar resolverá algo tan importante en nuestras vidas como es eso!</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Por ello, Partido Cacho&nbsp;Burro se presenta a estas elecciones con el único pero importantísimo objetivo de crear un genio.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>El candidato, no podía ser otro, nadie podría conseguir superar al Maestro Jorch: DIEGO, sobrino de Paqui (a partir de ahora DEIDAD):</DIV>\r\n<DIV><BR></DIV>\r\n<DIV><IMG src=\"https://fbcdn-sphotos-a.akamaihd.net/hphotos-ak-ash4/s720x720/404888_130647830388361_100003294352854_146378_1993534904_n.jpg\"></DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Ahorra que estáis convencidos. Ahorra que veis la importancia de lo que os trato de explicar os paso a exponer algunos de las medidas que esta hermandad tomarrá parra la consecución de dicho objetivo, del objetivo más importante de nuestra vida, porqué no reconocerlo.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Se realizarán las siguientes acciones:</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- DEIDAD vendrá a todas nuestras quedadas importantes para que absorba lo grande de cada uno. Vea el alma de este grupo y la tome como propia. En especial se intentarrá que mantenga el máximo contacto con su Maestro, ya sea vía skype o subvencionando viajes a chile con el dinerro de Maillo.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- La hermandad serrá su familia. Las mujeres y Loren serán sus madres y los hombres sus padres. Exceptuando a Diego de Lorca, que, obviamente, será su tío.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>- Toda la hermandad, en presencia de DEIDAD, deberrá hablar con el acento que, actualmente, tiene DEIDAD porque no queremos que lo pierda escuchándonos hablar normal, ¿verdad? (Se puede ver en este mismo comunicado con las rr\'s dobles)</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Estas son algunas de las ideas que tenemos, desde el PCB, para que DEIDAD sea el más grande todos los tiempos. El nuevo chiquito, Juanito Navarro y Ozores juntos. Nuestra nueva referencia y que así, la Hermandad Robot, mantenga su explendor cuando ninguno de nosotros ya no estemos.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Esperro vuestras aportaciones y vuestra confianza.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>Un abrazo.</DIV>\r\n<DIV><BR></DIV>\r\n<DIV>El Partido Cacho Burro.</DIV>','https://fbcdn-sphotos-a.akamaihd.net/hphotos-ak-ash4/225651_10150162377236447_649296446_7124944_317678_n.jpg',19,'2012-02-27 20:52:04'),(11,'Pako&Sam','PIS','Mi partido tiene una propuesta única. Si ganamos, haremos la máxima presión posible para que Pako y Samuel se den un pico delante de todo Re: Guapos.<br>Estoy abierto a negociaciones.<br>El resto de labores gobernativas serán derogadas a alguno de los partidos que me apoye.<br>','http://sanchezdetoro.webcindario.com/brokeback06.jpg',21,'2012-02-28 12:13:57');
