INSERT INTO `elections_comment` VALUES (1,1,'tepuedesquemar','el mejor justiciero justidiestro justicierto justifiero justimuero.','2012-02-24 17:43:39','84.79.233.116'),(2,1,'Siner','Por cierto, si subes el código a github dímelo y si quieres te echo una mano :)','2012-02-24 17:54:06','84.121.1.130'),(3,4,'Dios','Magnífico xD.','2012-02-27 10:11:08','87.222.143.251'),(4,2,'Sergiopero','La verdad es que no he leído aun los demás, pero el PRHH ha puesto el listón alto. Un discurso sobrio, cercano, sin grandilocuencias, y una apuesta fuerte por el reencuentro de las personas. Solo le faltaba haber escrito todo el programa en femenino.','2012-02-27 10:13:18','85.53.94.170'),(5,2,'Samercito','¡Me gusta! Empezad conmigo, quiero conocer a todas las chicas de la HR bien y creo que la mejor forma es que quede yo con todas a solas para practicar una actividad... no sé, por ejemplo... UNA ORGIA!!!','2012-02-27 10:41:30','84.124.149.203'),(6,2,'sary','Me gusta!! quiero que dante me enseñe algún juego! e ir en busca de los murciélagos pero sin cazarlos.','2012-02-27 11:12:56','85.53.94.170'),(7,2,'Pako','He de denunciar que un 33.3% de este programa electoral es mio.\r\n\r\nDe hecho lo más gracioso, lo de cazar murciélagos lo escribí YOO!!!!!','2012-02-27 11:54:33','155.54.205.72'),(8,1,'Pako','Qué Siner? Ya te has despertao?','2012-02-27 12:01:47','155.54.205.72'),(9,6,'Pako','Descubre tu identidad o te comerás una mierda.','2012-02-27 14:46:17','155.54.205.72'),(10,7,'Samuel','Vota a Loren. Él te votaría a ti.','2012-02-27 15:22:41','95.131.160.42'),(11,7,'Pako','Mi partido tiene una vertiente ideológica de fomentar la Reinserción del Súcubo (fomenta evitar el odio a los súcubos) y si me he presentado a las elecciones es que estoy a favor de la democracia. ¿Qué tienes entonces en contra de mi partido que no lo nombras?','2012-02-27 15:26:16','155.54.205.72'),(12,7,'elcochedeMaíllo','¡¡¡brrrruuummm bruuuuum brrrruuuummmm!!!','2012-02-27 15:33:56','195.55.166.178'),(13,7,'Samuel','Eso tendrías que hablarlo con Loren pero, la visión que das al pueblo llano es que nos quieres vender el mismo perro con distinto collar. Quieres salvar todo tu programa de odio basándote en una pequeña parecela de tu programa y eso no cuela. Pero vamos, que no soy yo quien debe decirte esto sino Loren.','2012-02-27 15:50:27','95.131.160.42'),(14,4,'Ateo','Lo mejor de tu partido es la foto de Pablol, que tiene mucha fuerza.','2012-02-27 15:54:24','95.131.160.42'),(15,7,'Ruf','¡Qué bien redactas, Loren!','2012-02-27 15:56:37','88.23.250.69'),(16,2,'Samuel','Mirad a Pako creando disputas y odio. ','2012-02-27 15:56:49','95.131.160.42'),(17,8,'elcochedeMaíllo','¡¡bruuuuuuuuuuuuuuuuuuuuum!!','2012-02-27 15:59:45','195.55.166.178'),(18,7,'Sergiopero','Me parece contradictorio la propuesta del grupo de Whatsapp con la ideología antimachista del partido. Ya que seguro que acaba teniendo una vertiente de hombres cosificando a las mujeres con las que hacen el amor.','2012-02-27 16:01:32','85.53.94.170'),(19,8,'Sergiopero','que dejen de poner mas partidos, esto esta decidido, aquí tenemos al ganador.','2012-02-27 16:02:35','85.53.94.170'),(20,8,'Pako','jajajajaja grandioso!','2012-02-27 16:03:26','155.54.205.72'),(21,7,'Pako','Sergio tiene razón. Menudo puñado de calumnias y sinsentidos que tiene este programa. Loren, despide al negro que te ha redactado esto.','2012-02-27 16:04:46','155.54.205.72'),(28,7,'Sergiopero','Pasa del PAS tiene gancho','2012-02-27 16:45:16','85.53.94.170'),(23,7,'Samuel','Sergio: el grupo Re: polvos está pensado para ser mixto y ensalzar las virtudes del acto amatorio. Cualquier otra visión que se salga de ahí, va en contra de nuestro partido.','2012-02-27 16:10:36','95.131.160.42'),(24,7,'Samuel','Pako: tu campaña de insidias y calumnias no hace más que dar la razón a los gritos populares: \"¡PASA DEL PAS!\". Fomentas el odio y la gente lo sabe.','2012-02-27 16:11:39','95.131.160.42'),(25,8,'Ruf','¡CÓPIER!','2012-02-27 16:12:22','88.23.250.69'),(27,6,'Samuel','Cómo no, Pako amenazando.','2012-02-27 16:13:01','95.131.160.42'),(29,7,'Loren','Gracias por los comentarios, amigos, tanto los constructivos como los pretenciosos. Me harán esforzarme en mejorar este nuestro gran partido.\r\nUn cálido abrazo.','2012-02-27 19:24:53','79.109.188.90'),(30,8,'Fiesta','Jajajajajaja Quién ha subido mi historia de prueba??? jajajajajaa','2012-02-27 19:36:36','88.25.200.144'),(31,7,'Fiesta','Debo reconocer que este partido me crea simpatía pero no veo acciones concretas, sólo intenciones, salvo en el apartado \"Re: Polvos\".\r\nVeo que intentas luchar contra el machismo a favor de salud, medio ambiente, tolerancia y acentos graciosos pero que acciones vas a tomar para conseguir dichos objetivos.\r\nNecesitamos más si quieres nuestro voto.\r\n\r\nUn saludo.','2012-02-27 19:45:29','88.25.200.144'),(32,5,'ElJeep','¡¡Bruuuuuuuummmmmm TÚ!!','2012-02-27 19:46:36','88.25.200.144'),(33,7,'Samuel','Se usarán todas las vías posibles dentro de las líneas del respeto, la tolerancia, la igualdad, el diálogo y la defensa de todos los valores de la democracia.','2012-02-27 20:24:58','95.131.160.42'),(34,10,'Samuel','¡Muy gracioso este partido! Me gusta :).\r\n\r\nPD: qué guapo sale Jorge en la foto.','2012-02-27 21:27:34','95.131.160.42'),(35,10,'eslaquer','Sintonizo bastante con este partido, la verdad.','2012-02-27 21:29:54','84.79.233.116'),(37,8,'Samuel','No se me ve la foto :(.','2012-02-27 21:54:37','95.131.160.42'),(38,10,'Pako','jajajja muy divertido! Pero era cacho burro, no cacho perro xD','2012-02-28 09:33:32','155.54.205.72'),(39,10,'PCB','¡Corregido! ¡Importante aporte! Gracias.','2012-02-28 09:39:52','193.147.143.23'),(40,7,'Pako','Vaya partido más vacío por dentro y vaya tongazo.','2012-02-28 09:42:16','155.54.205.72'),(41,7,'Anónimo','Vaya, Pako... parece que si un partido no habla de arrancar cabezas a aquellos que no se comportan como tú, ya está vacío por dentro. ¡Lo que está es vacío de odio! ¡Deberías tomar ejemplo del Loren Party!','2012-02-28 10:38:05','95.131.160.42'),(42,7,'Samuel','Vaya, Pako, parece que ese tal anónimo te ha puesto en tu sitio.','2012-02-28 10:38:22','95.131.160.42'),(43,7,'Pako','Lo siento anónimo, el debate está en re guapos. Nos vemos alli ;)','2012-02-28 11:04:04','155.54.205.72'),(44,11,'Ruf','Tu partido se complementa perfectamente con la filosofía PRRH. Pako y Sam podrían ser los dos individuos y darse un pico la actividad que os acercaría. Debemos entablar negociaciones.','2012-02-28 12:22:05','195.53.56.195'),(45,11,'Dios','Esto es una apuesta muuuy fuerte.','2012-02-28 12:29:17','87.222.143.251'),(46,11,'Pako','jajaja gracioso!','2012-02-28 12:31:33','155.54.205.72'),(47,11,'Pako','El PAS no tendría problema en pactar con el PIS. Ya he besado a otros miembros del grupo con erótico resultado.','2012-02-28 12:33:37','155.54.205.72'),(48,11,'Sergiopero','No se quien sera el cabeza de lista de este partido, pero desde luego tiene un gran director de campaña. Ha sabido ver el gran nicho de opinion del momento, auguro que dara mucha guerra','2012-02-28 12:33:41','85.53.94.170'),(49,11,'Pako','Nuestro pacto solucionaría todos los problemas de la Hermandad Robot en un PIS PAS!','2012-02-28 12:39:19','155.54.205.72');
